import React from "react";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";

const PerfectWeight = props => {
  return (
    <div
      style={{
        padding: "0",
        margin: 0
      }}
    >
      <strong>{props.title}</strong>
      <BarChart
        width={500}
        height={300}
        data={props.data}
        margin={{
          top: 0,
          right: 0,
          left: 0,
          bottom: 0
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="x" />
        <YAxis domain={[0, 5]} />
        <Tooltip />
        <Legend />
        <Bar dataKey="ra" fill="royalblue" />
        <Bar dataKey="Devine" fill="lightred" />
        <Bar dataKey="Hamwi" fill="yellow" />
        <Bar dataKey="Hamwi" fill="yellow" />
        <Bar dataKey="Hamwi" fill="yellow" />
        <Bar dataKey="My weight" fill="royalblue" />
      </BarChart>
    </div>
  );
};

export default PerfectWeight;
